CREATE TABLE [dbo].[Guarantor] (
    [Id]             INT           IDENTITY (1, 1) NOT NULL,
    [CustomerId]     INT           NULL,
    [GuarantorName]  VARCHAR (30)  NOT NULL,
    [NIC]            VARCHAR (20)  NOT NULL,
    [Contact]        VARCHAR (20)  NOT NULL,
    [PrimaryAddress] VARCHAR (100) NOT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC),
    FOREIGN KEY ([CustomerId]) REFERENCES [dbo].[Customer] ([Id]) ON DELETE CASCADE ON UPDATE CASCADE
);

SET IDENTITY_INSERT [dbo].[Guarantor] ON
SET IDENTITY_INSERT [dbo].[Guarantor] OFF


CREATE TABLE [dbo].[CustomerOrder] (
    [Id]                 INT  IDENTITY (1, 1) NOT NULL,
    [CustomerId]         INT  NULL,
    [UserId]             NVARCHAR(128)  NULL,
    [GuarantorId]        INT  NULL,
    [OrderDate]          DATE NOT NULL,
    [MonthlyInstallment] INT  NOT NULL,
    [DueDate]            DATE NOT NULL,
    PRIMARY KEY CLUSTERED ([Id] ASC),
    FOREIGN KEY ([CustomerId]) REFERENCES [dbo].[Customer] ([Id]) ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY ([UserId]) REFERENCES [dbo].[AspNetUsers] ([Id]) ON UPDATE CASCADE,
    FOREIGN KEY ([GuarantorId]) REFERENCES [dbo].[Guarantor] ([Id])
);


SET IDENTITY_INSERT [dbo].[CustomerOrder] ON
SET IDENTITY_INSERT [dbo].[CustomerOrder] OFF
